import React from 'react';

const Subscribe = () => {
  return (
    <div className="px-4 sm:px-8">
      <div className="mb-48 bg-white">
        {/* Title Section */}
        <div className="max-w-[1052.76px] mx-auto text-center my-10">
          <div>
            <span className="text-black text-[76px] sm:text-[76px] font-normal font-['Thunder'] leading-[60px] sm:leading-[107.08px] tracking-wide">
              Become a member of the collective
            </span>
          </div>
          <div>
            <span className="text-black text-[36px] sm:text-[36px] font-normal font-['Thunder'] leading-[60px] sm:leading-[107.08px] tracking-wide">
              The first month is on us!
            </span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Subscribe;
